DROP TABLE `person`;

CREATE TABLE `person` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `person_id` varchar(13) default NULL,
  `person_name` varchar(255) default NULL,
  `person_email` varchar(255) default NULL,
  `cell` varchar(100) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

